import React from "react";

const ComponenteDez = (props) => {
  const estilo = {
    color: "white",
    padding: "10px",
    backgroundColor: "yellow",
  };

  return (
    <div className="componente">
      <h1 className="titulo">Título: {props.titulo}</h1>
      <p style={estilo}>Texto do parágrafo</p>
    </div>
  );
};
export default ComponenteDez;
